import React from 'react';
import { Tab, Nav } from 'react-bootstrap';
const Sidebar = ({ id }) => {
  return (
    <div style={{ width: '250px' }} className='d-flex flex-column'>
      <Tab.Container>
        <Nav>
          <Nav.Item>
            <Nav.Link>Conversations</Nav.Link>
          </Nav.Item>
        </Nav>
      </Tab.Container>
    </div>
  );
};

export default Sidebar;
